import React from "react";
import RoleComponent from "./components/roleComponent";

const App = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-4">Zona de Poder</h1>
      <RoleComponent />
    </div>
  );
};

export default App;
